import "./role.css"

const Role = () => {
  return (
    
      <div className="allRoleContainer">
  
        <div class="cardRole">
          <div class="card-details">
            <p class="text-title">Card title</p>
            <p class="text-body">Here are the details of the card</p>
          </div>
          <div class="card-button">More info</div>
        </div>
      </div>
    
  );
};

export default Role;
